const createWrapper = (component, options = {}, storeState = {}) => {
  const store = createVuexStore(storeState)
  const router = createVueRouter()

  return mount(component, {
    global: {
      plugins: [
        store
      ],
      directives: {
        tooltip: Tooltip
      }
    },
    ...options
  })
}

